function Intro({ intro, setIntro }) {

    var typing = new Typed('.text', {
      strings: [
        'Web Designer',
        'Freelancer',
        'Graphics Designer',
        'Web Developer',
      ],
      typeSpeed: 100,
      backSpeed: 40,
      loop: true,
    });
  return (
    <div className="intro-style">
      <h1>WeatherTape</h1>
    </div>
  );
}

export default Intro;
